import './App.css';
import axios from 'axios';
import item from '../../server/datas.json'
import { useState, useEffect } from 'react';

function App() {
  const [items, setItems] = useState([]); 
  const [newItem, setNewItem] = useState({ name: "", age: "", mobileno: "", city: "" }); 
  const [editingItem, setEditingItem] = useState(null); 

  useEffect(() => {
    fetchItems(); 
  }, []);

  const fetchItems = async () => {
    try {
      const { data } = await axios.get(`http://localhost:5050/datas`);
      setItems(data);
    } catch (error) {
      console.error("Error fetching items:", error);
    }
  };

  const handleCreate = async () => {
    try {
      await axios.post(`http://localhost:5050/datas`, newItem);
      setNewItem({ name: "", age: "", mobileno: "", city: "" });
      fetchItems(); 
    } catch (error) {
      console.error("Error creating item:", error);
    }
  };

  const handleUpdate = async (id) => {
    try {
      await axios.put(`http://localhost:5050/datas/${id}`, editingItem);
      setEditingItem(null);
      fetchItems();
    } catch (error) {
      console.error("Error updating item:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5050/datas/${id}`);
      fetchItems(); 
    } catch (error) {
      console.error("Error deleting item:", error);
    }
  };

  return (
    <>
      <div className="container">
        <div className="operations">
          <h3>CRUD Operations</h3>

          <div className="inputs">
            <input
              type="text"
              placeholder="Name"
              value={newItem.name}
              onChange={(e) => setNewItem({ ...newItem, name: e.target.value })}
            />
            <input
              type="text"
              placeholder="Age"
              value={newItem.age}
              onChange={(e) => setNewItem({ ...newItem, age: e.target.value })}
            />
            <input
              type="text"
              placeholder="Mobile Number"
              value={newItem.mobileno}
              onChange={(e) => setNewItem({ ...newItem, mobileno: e.target.value })}
            />
            <input
              type="text"
              placeholder="City"
              value={newItem.city}
              onChange={(e) => setNewItem({ ...newItem, city: e.target.value })}
            />
            <button className="btn-green" onClick={handleCreate}>Add</button>
          </div>

          <div className="table">
            <table>
              <thead>
                <tr>
                  <th>S.No</th>
                  <th>Name</th>
                  <th>Age</th>
                  <th>Mobile Number</th>
                  <th>City</th>
                  <th>Edit</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {items.map((item, index) => (
                  <tr key={item._id}>
                    <td>{index + 1}</td>
                    <td>
                      {editingItem?._id === item._id ? (
                        <input
                          type="text"
                          value={editingItem.name}
                          onChange={(e) =>
                            setEditingItem({ ...editingItem, name: e.target.value })
                          }
                        />
                      ) : (
                        item.name
                      )}
                    </td>
                    <td>
                      {editingItem?._id === item._id ? (
                        <input
                          type="text"
                          value={editingItem.age}
                          onChange={(e) =>
                            setEditingItem({ ...editingItem, age: e.target.value })
                          }
                        />
                      ) : (
                        item.age
                      )}
                    </td>
                    <td>
                      {editingItem?._id === item._id ? (
                        <input
                          type="text"
                          value={editingItem.mobileno}
                          onChange={(e) =>
                            setEditingItem({ ...editingItem, mobileno: e.target.value })
                          }
                        />
                      ) : (
                        item.mobileno
                      )}
                    </td>
                    <td>
                      {editingItem?._id === item._id ? (
                        <input
                          type="text"
                          value={editingItem.city}
                          onChange={(e) =>
                            setEditingItem({ ...editingItem, city: e.target.value })
                          }
                        />
                      ) : (
                        item.city
                      )}
                    </td>
                    <td>
                      {editingItem?._id === item._id ? (
                        <button
                          className="btn-green"
                          onClick={() => handleUpdate(item._id)}
                        >
                          Save
                        </button>
                      ) : (
                        <button
                          className="btn-green"
                          onClick={() => setEditingItem(item)}
                        >
                          Edit
                        </button>
                      )}
                    </td>
                    <td>
                      <button
                        className="btn-red"
                        onClick={() => handleDelete(item._id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
